import React from 'react';
import Card from './Card';


const CardList = (props) => {
    const robots = props.robot;
    return (
        <div>
            for (robot of robots) {
                <Card id={robot.id} name={robot.name} email={robot.email} />
            }
        </div>
    )
}

export default CardList
